import React from 'react';
import { NavLink } from 'react-router-dom';
import FullTable from '../../../../../components/cryptX/tables/React/FullTable';


const ComingSoon = () => {
    return (
        <React.Fragment>
            <div className="auth-wrapper offline">
                <div className="text-center">
                    <h1 className="mb-4">Coming Soon</h1>
                    <h5 className="text-muted mb-4">Our site is under construction - 10 days to go</h5>
                    <NavLink to="/" className="btn btn-primary mb-4"><i className="feather icon-home"/>Back to Home</NavLink>
                </div>
                <FullTable></FullTable>
            </div>

        </React.Fragment>
    );
};

export default ComingSoon;
